class Solution {
    public int minimumBeautifulSubstrings(String s) {
        int n = s.length();
        // Powers of 5 in binary representation up to the maximum length of s
        String[] powersOf5 = {"1", "101", "11001", "1111101", "1001110001", "110000110101", "11110100001001"};
        int[] dp = new int[n + 1];
        // Initialize dp array
        for (int i = 0; i <= n; i++) {
            dp[i] = Integer.MAX_VALUE;
        }
        dp[0] = 0; // base case

        for (int i = 1; i <= n; i++) {
            for (String power : powersOf5) {
                int end = i;
                int start = i - power.length();
                if (start >= 0 && s.substring(start, end).equals(power)) {
                    if (dp[start] != Integer.MAX_VALUE) {
                        dp[i] = Math.min(dp[i], dp[start] + 1);
                    }
                }
            }
        }

        return dp[n] == Integer.MAX_VALUE ? -1 : dp[n];
    }
}
